using System;
using System.Text; 

namespace ICSharpCode.AvalonEdit.CodeCompletion
{

	/// <summary>
	/// Get 1st letter of pinyin for Chinese Char. (Only support Unicode.)
	/// </summary>
	public static class ChinesePinYin
	{
		/// <summary>
		/// Convert full-width chars to half-width chars.
		/// </summary>
		/// <param name="text"></param>
		/// <returns></returns>
		public static string FatAlphaAndNumbersToThin(string text)
		{
			var myStr = new StringBuilder();            

			foreach (char vChar in text) {
				if ((vChar >= 'a' && vChar <= 'z') || (vChar >= 'A' && vChar <= 'Z')) {
					myStr.Append(vChar);
				} else if (vChar >= 'Ａ' && vChar <= 'Ｚ') {//full-width upcase letter to half-width letter.
					int offset = (int)'Ａ' - (int)'A';
					myStr.Append((char)((int)vChar - offset));
				} else if (vChar >= 'ａ' && vChar <= 'ｚ') {//full-width lowercase letter to half-width letter.
					int offset = (int)'ａ' - (int)'a';
					myStr.Append((char)((int)vChar - offset));
				} else if (vChar >= '０' && vChar <= '９') {
					int offset = (int)'０' - (int)'0';
					myStr.Append((char)((int)vChar - offset));
				} else {
					myStr.Append(vChar);
				}
			}
			return myStr.ToString();
		}        

		/// <summary>
		/// Get 1st letter of pinyin for Chinese Char. (Only support Unicode.)
		/// Convert full-width number or letter to half-width.
		/// Convert Chenese char to the 1st letter of it's PinYin.
		/// </summary>
		public static char GetFirstAlphaOfChinesePinYin(char c)
		{
			if (c >= 0 && c < 256)return c;            

			if (c >= 'Ａ' && c <= 'Ｚ') {
				int offset = (int)'Ａ' - (int)'A';
				return (char)((int)c - offset);
			}            

			if (c >= 'ａ' && c <= 'ｚ') {
				int offset = (int)'ａ' - (int)'a';
				return (char)((int)c - offset);
			}            

			if (c >= '０' && c <= '９') {
				int offset = (int)'０' - (int)'0';
				return (char)((int)c - offset);
			}            

			if ((c >= 'a' && c <= 'z') || (c >= 'A' && c <= 'Z'))return c;            

			int index = (int)c - 19968;
			if (index >= 0 && index < strChineseFirstPY.Length)
				return strChineseFirstPY[index];          

			return c;
		}        

		/// <summary>
		/// Get 1st letters of pinyin for Chinese Char. (Only support Unicode.) Create by XDesigner.
		/// </summary>
		public static string ToChinesePinYinText(string strText)
		{
			if (string.IsNullOrEmpty(strText))
				return strText;

			var myStr = new System.Text.StringBuilder();

			int index = 0;

			foreach (char vChar in strText) {
				if ((vChar >= 'a' && vChar <= 'z') || (vChar >= 'A' && vChar <= 'Z'))
					myStr.Append(char.ToUpper(vChar));
				else {
					index = (int)vChar - 19968;
					if (index >= 0 && index < strChineseFirstPY.Length)
						myStr.Append(strChineseFirstPY[index]);
				}
			}           

			return myStr.ToString();
		}
        
		/// <summary>
		/// Upcase letters List. 1st letters of pinyin for Chinese Chars. (Only support Unicode.)
		/// There's 20902 Chinese chars. For ToChinesePinYinText() method.
		/// Unicode code from 19968 to 40869. Create by XDesigner.
		/// </summary>
		private static readonly string strChineseFirstPY =
			"";
	}
}
